import 'react-native-gesture-handler';
import React, { Component } from 'react';
import { StyleSheet, Text, View, Button, SafeAreaView } from 'react-native';
import { NavigationContainer } from '@react-navigation/native';
import { createStackNavigator } from '@react-navigation/stack';
import BudgetScreen from "./BudgetScreen.js";
import CurrencyScreen from "./CurrencyScreen.js";
import CategoryScreen from "./CategoryScreen.js";

function Set() {
  return (
    <View style={{ flex: 1, flexdirection:'column', justifyContent: 'top' }}>
      <View style = {styles.label}>
        <Text>first try</Text>
      </View>
      <Text>Setting Screen</Text>
    </View>
  );
}

class SettingScreen extends React.Component {
    render(){

      const Stack = createStackNavigator();
      return (
        <Stack.Navigator initialRouteName="Set">
          <Stack.Screen name="Set" component={Set} />
        <Stack.Screen name="BudgetScreen" component={BudgetScreen} />
        <Stack.Screen name="CurrencyScreen" component={CurrencyScreen} />
        <Stack.Screen name="CategoryScreen" component={CategoryScreen} />
        </Stack.Navigator>
      );
    }
  }


    const styles = StyleSheet.create({
      container: {
        flex: 1,
        backgroundColor: '#fff',
        alignItems: 'center',
        justifyContent: 'center',
      },

      label: {
        textAlign: "center",
        marginBottom: 40,
        fontSize: 50,
        backgroundColor: '#66b2ff',
        height: 50,
      }

    });

    export default SettingScreen;
